import { useContext } from 'react'
import { IBrandDto } from '../../../../Api/dto/IBrand'
import BrandsContext from '../../../../Context/BrandsContext'
import WorkingSpaceContext from '../../../../Context/WorkingSpaceContext'
import { MenuEnum } from '../../../../Enums/MenuEnums'
import BrandInput from './outputPanel-brandInput/BrandInput'
import BrandItem from './outputPanel-brandItem/BrandItem'
import styles from './OutputPanel.module.scss'

export default function OutputPanel() {

    function ResponseBlock() {
        const value = useContext(WorkingSpaceContext)
        const brandsContext = useContext(BrandsContext)

        if (value.menuState === MenuEnum.Brands) {
            if (value.controlPanelState === 'Создать' && brandsContext.brands?.created !== undefined) {
                const data: IBrandDto[] = brandsContext.brands?.created
                const brandsList = data.map((item, index) => {
                    return (
                        <BrandItem
                            key={index}
                            value={item}
                        ></BrandItem>)
                })
                return (
                    <div>
                        {brandsList}
                    </div>)
            }
            else if (value.controlPanelState === 'Получить' && brandsContext.brands?.all !== undefined) {
                const data: IBrandDto[] = brandsContext.brands?.selected
                const brandsList = data.map((item, index) => {
                    return (
                        <BrandItem
                            key={index}
                            value={item}
                        ></BrandItem>)
                })
                return (
                    <div>
                        {brandsList}
                    </div>)
            }
            else if (value.controlPanelState === 'Обновить' && brandsContext.brands?.all !== undefined) {
                const data: IBrandDto[] = brandsContext.brands?.selected
                const brandsList = data.map((item, index) => {
                    return (
                        <>
                            <BrandInput
                                key={index}
                                value={item}
                            ></BrandInput>
                            <button className={styles['controlPanel-submit']}>
                                <div
                                    onClick={() => update()}
                                >Отправить запрос</div>
                            </button>
                        </>
                    )
                })
                return (
                    <div>
                        {brandsList}
                    </div>)
            }
        }
        return (<></>)
    }

    return (
        <div className={styles['outputPanel']}>
            <ResponseBlock></ResponseBlock>
        </div>
    )
}
